import React from "react";
import "../style/css/style.css";
import "../style/StyleJS";
import Header from "./Header";
import ArticleSlider from "./ArticleSlider";
import Articles from "./Articles";
import SideBar from "./SideBar";

const App = () => {
    return (
        <div>
            <Header />
            <ArticleSlider />
            <section
                id="main-body-section"
                class="main-body-section d-flex p-5 mt-5 mb-5"
            >
                <h6 class="card-subtitle mb-2 text-muted text-capitalize text-center">
                    other article{" "}
                </h6>
                <Articles />
                <SideBar />
            </section>
        </div>
    );
};

export default App;
